import './Footer.css';

export default function Footer() {
  return (
    <footer className="footer">
      <div className="container">
        <p>Photo credits <a href="https://www.larkzvisuals.com.au/" target="_blank">Larkz Visuals</a> </p>
      </div>
    </footer>
  );
}
